import React from "react";

interface PixelProps {
    x: number;
    y: number;
    color: string;
    size: number;
}

const Pixel: React.FC<PixelProps> = ({x, y, color, size}) => {

    const pixelStyles = {
        width: size,
        height: size,
        backgroundColor: color
    };

    return <div style={pixelStyles}></div>
}

export default Pixel;
